- input: TEXT,F3XA,,"The entries itemized on the memo schedule itemized each individual
    who has contributed an aggregate in excess of $200.00.  (ii) There were no employees
    who spent more 25% of their time on FEA during the period of April thru June.  (iii)
    the itemized disbursements have been clarified. (iv) the payments to credit card
    vendors have memo entries of each vendor paid for along with the date and amount
    of each entry. (v) no fridge benefits paid for any employees that spent more than
    25% of their time, were allocated between non federa account.   (vii) the signs
    printed clearly identify a candidate nor did they nor did they support oppose
    or attack a federal office or candidate.  (viii) the payment for 'booth' was to
    participate in a state fair and did not refer to any clearly identified federal
    candidate. (ix) neither the voter file maintenance nor the surveys paid for on
    this report were connected with any candidates for federal office. (x) the expenditure
    made for our annual Dinner were not made on behalf of any specifically identified
    federal candidate and was allocated according to the funds recieved method.  The
    expenditure has also been catergorized as fundraising. (xi) the ration has been
    corrected and non federal account did not overpay the federal account due to miscalculation."
